+int Matcher::offset_for_null_check(int previous_offset, int last_insn_offset) {
+  // On aarch64, no matter what addressing mode is used, LDR/STR is always the last
+  // instruction in the instruction clause emitted for a load/store machine node.
+  return last_insn_offset - Pipeline::instr_unit_size();
+}
